import React from 'react'
import ReactDom from 'react-dom'

function MainScreen() {
    return (  
        <section>
            <h1>Eye Expense</h1>
            <input type='Enter expenses'/>
            <button>Submit</button>
        </section>
    );
}

ReactDom.render(<MainScreen />, document.getElementById('root'));
